import Navbar from "components/Navbar";

const About = () => {
  return (
    <>
      <style jsx global>{`
        body {
          background-image: url("/aboutmatty.jpeg");
          background-position: 0px -150px;
          height: 100vh;
          position: fixed;
          top: 64px;
          width: 100%;
        }
      `}</style>
    </>
  );
};

export default About;
